import React from 'react';

const AuthorPage = () => {
  return (
    <div className="author-page">
      {/* Фоновые элементы */}
      <div className="backgroundBlock"></div>
      <div className="overlappingImages">
        {/* Здесь могут быть ваши декоративные изображения */}
      </div>

      {/* Основное содержимое */}
      <div className="textContainer_author">
        <div className="largeText">
          <h2>Об авторе</h2>
        </div>

        <div className="author-content">
          <div className="smallText">
            <h3>Тихонова Виктория Андреевна</h3>
            <p>
              Данный проект разработан в качестве дипломной работы на курсе 
              <strong> "Институт Интеллектуальной Робототехники"</strong>, 
              направление <strong>"Мехатроника и Робототехника"</strong>.
            </p>

            <div className="acknowledgments">
              <h4>Благодарности</h4>
              <p>
                Выражаем благодарность <strong>Василию Постных </strong> 
                 за предоставленные данные для разработки проекта.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AuthorPage;
